        <div class=\"form-group\">
            {{ form_widget(form.login, { 'attr': {'class': 'form-control btn btn-primary btn-block'} }) }}
        </div> <!-- form-group// -->                                                           
    </form>
</article>
</div> <!-- card.// -->
</div>
{% endblock %}
